CREATE TABLE IF NOT EXISTS `Amenities` (
  `amenity_id` varchar(4) NOT NULL DEFAULT '',
  `description` varchar(320) NOT NULL,
  PRIMARY KEY (`amenity_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `Currencies` (
  `currency` char(3) NOT NULL DEFAULT '',
  `symbol` char(1) DEFAULT NULL,
  `text` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`currency`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `IncludedAmenities` (
  `listing_id` int(11) NOT NULL DEFAULT '0',
  `amenity_id` varchar(4) NOT NULL DEFAULT '',
  PRIMARY KEY (`listing_id`,`amenity_id`),
  KEY `amenity_id` (`amenity_id`),
  CONSTRAINT `IncludedAmenities_ibfk_1` FOREIGN KEY (`amenity_id`) REFERENCES `Amenities` (`amenity_id`),
  CONSTRAINT `IncludedAmenities_ibfk_2` FOREIGN KEY (`listing_id`) REFERENCES `Listings` (`listing_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `Listings` (
  `listing_id` int(11) NOT NULL DEFAULT '0',
  `address` varchar(320) DEFAULT NULL,
  `image` varchar(320) DEFAULT NULL,
  `beds` int(11) DEFAULT NULL,
  `baths` int(11) DEFAULT NULL,
  `price` decimal(11,2) DEFAULT NULL,
  `currency` char(3) DEFAULT NULL,
  `safety_rating` int(11) DEFAULT NULL,
  `link` varchar(320) DEFAULT NULL,
  `latitude` double DEFAULT NULL,
  `longitude` double DEFAULT NULL,
  `Agent_id` char(4) NOT NULL,
  PRIMARY KEY (`listing_id`),
  KEY `Agent_id` (`Agent_id`),
  KEY `currency` (`currency`),
  CONSTRAINT `Listings_ibfk_1` FOREIGN KEY (`Agent_id`) REFERENCES `RealEstateAgents` (`agent_id`),
  CONSTRAINT `Listings_ibfk_2` FOREIGN KEY (`currency`) REFERENCES `Currencies` (`currency`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `RealEstateAgents` (
  `agent_id` char(4) NOT NULL DEFAULT '',
  `description` varchar(320) NOT NULL,
  `email_id` varchar(320) DEFAULT NULL,
  `phone_no` varchar(320) DEFAULT NULL,
  PRIMARY KEY (`agent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;





